import React from 'react';
//import { useHistory, Link } from "react-router-dom";

function NavButtons(props) {

    /* let history = useHistory(); */


    return ( <
        div className = "container d-flex m-3 col-lg-2" >
        <
        div className = "container col-lg-6" >
        <
        i class = "fas fa-chevron-down"
        style = {
            {
                color: "rgb(33, 177, 177)"
            }
        } > < /i> <
        button className = "bShAcconuts2" > < i class = "far fa-user" > < /i></button >
        <
        /div> <
        button className = "btn bShAcconuts col-lg-6" > +Add Account < /button> <
        div class = "input-group" >
        <
        div class = "form-outline" >
        <
        input type = "search"
        id = "form1"
        class = "form-control" / >
        <
        label class = "form-label"
        for = "form1" > Search < /label> <
        /div> <
        button type = "button"
        class = "btn btn-primary" >
        <
        i class = "fas fa-search" > < /i> <
        /button> <
        /div> <
        /div> 

    )
}
export default NavButtons;
